;; **
;;; # Rmarkdown Example: generating visual reports using R from Clojure
;;; 
;;; This tutorial is part of the [clojure data science course](https://clojure-data-science-course.github.io/). See more examples [here](https://github.com/clojure-data-science-course/examples).
;;; 
;;; It is a Gorilla REPL worksheet. Shift + enter evaluates code. Hit alt+g twice in quick succession or click the menu icon (upper-right corner) for more commands ...
;;; 
;;; In this worksheet, we show how to mix two ways for generating web pages:
;;; - Clojure's [hiccup](https://github.com/weavejester/hiccup) library, that allows us to represent html pages as Clojure data structures;
;;; - [R](https://www.r-project.org/)'s [Rmarkdown](https://rmarkdown.rstudio.com/) library, that allows to create html pages with data driven visualizations, by the way of running R code blocks inside [mardkown](https://en.wikipedia.org/wiki/Markdown) documents.
;;; 
;;; Most of the examples in this worksheet will soon be generalized in a library that we are working on.
;;; 
;;; To run this worksheet, you need to install R at your machine, as well as two of its important packages: [RMarkdown](https://rmarkdown.rstudio.com/), [ggplot2](https://www.tidyverse.org/), [Rserve](https://cran.r-project.org/web/packages/Rserve/index.html).
;;; 
;;; ~~~~
;;; 
;;; First, let us define our namespace.
;; **

;; @@
(ns examples.rmarkdown
  (:require [alembic.still :refer [distill]]
            [clojure.walk :as walk]
            [clojure.string :as string])
  (:import java.io.File))
