;; **
;;; We wish to generate htmls and show them in the gorilla worksheet. To make things easy in this demonstration, we will do this inside [iframes](https://en.wikipedia.org/wiki/HTML_element#Frames). We need to tell the Gorilla [Renderer](http://gorilla-repl.org/renderer.html) how to show things.
;; **

;; @@
(defn in-iframe [hiccup
                 {:keys [height]}]
  [:iframe {:width       "100%"
            :height      height
            :frameBorder "0"
            :srcdoc      (html hiccup)}])

(defn hiccup->gorilla [hiccup
                       {:keys [height]}]
  (reify gorilla-renderable.core/Renderable
    (render [self]
      {:type    :html
       :content (-> hiccup
                    (in-iframe {:height height})
                    html)
       :value   (pr-str self)})))


