;;; {"type":"html","content":"<span class='clj-var'>#&#x27;examples.rmarkdown/hiccup-&gt;gorilla</span>","value":"#'examples.rmarkdown/hiccup->gorilla"}
;; <=

;; **
;;; For example:
;; **

;; @@
(-> [:h1 "hi!"]
  	(hiccup->gorilla {:height 100}))
