;; **
;;; The following function will create a hiccup data structure with an html collapsible element ([using boostrap](https://getbootstrap.com/docs/4.1/components/collapse/)):
;; **

;; @@
(defn collapsible [{:keys [title]}
                   content]
  (let [id (str "block" (java.util.UUID/randomUUID))]
    [:div
     [:button {:class       "btn btn-primary"
               :data-toggle "collapse"
               :data-target (str "#" id)}
      (str "(show/hide) " title )]
     [:div {:id    id
            :class "collapse"}
      content]]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;examples.rmarkdown/collapsible</span>","value":"#'examples.rmarkdown/collapsible"}
;; <=

;; **
;;; We will use it later (bootstrap will be made available by rmarkdown).
;; **

;; **
;;; The following function will be used to create an R code block using in the format used in rmarkdown:
;; **

;; @@
(defn r-code-block [r-code]
  (str "\n```{r, echo=FALSE, message=FALSE, warning=FALSE}\n"
       r-code
       "\n```\n"))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;examples.rmarkdown/r-code-block</span>","value":"#'examples.rmarkdown/r-code-block"}
;; <=

;; **
;;; For example:
;; **

;; @@
(-> [[:qplot [:rnorm 99]]]
    gg/to-r
    r-code-block
    println)
;; @@
;; ->
;;; 
;;; ```{r, echo=FALSE, message=FALSE, warning=FALSE}
;;; qplot(rnorm(99))
;;; ```
;;; 
;;; 
;; <-
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; Now, let us define a function to translate Clojure data structures into Rmarkdown.
;;; 
;;; It will get datastructures of hiccup format, with the following new elements:
;;; - `[:collapsible hiccup1]` -- translates to a bootstrap-collapsible area (with `hiccup1` inside)
;;; - `[:r code]` -- translates to an R code block with the code `code`
;;; - `[:r-edn edn]` -- takes the [edn](https://github.com/edn-format/edn) structure `edn`, translates it to R code using gg4clj, and creates a correspinding R code block
;; **

;; @@
(defn hiccup->rmd [hiccup]
  (->> hiccup
       (walk/postwalk
        (fn [form]
          (if (vector? form)
            (case (first form)
              :collapsible (apply collapsible
                                  (rest form))
              :r           (-> form second r-code-block)
              :r-edn       (-> form second gg/to-r r-code-block)
              form)
            form)))
       html))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;examples.rmarkdown/hiccup-&gt;rmd</span>","value":"#'examples.rmarkdown/hiccup->rmd"}
;; <=

;; **
;;; For example:
;; **

;; @@
(->> [:div
      [:div [:h1 "A"]
       [:collapsible 	{:title "What's inside?"}
        				[:h1 "hi!"]]
       "\n"
       [:r "qplot(rnorm(99))"]
       [:r-edn [[:qplot [:rnorm 99]]]]]]
     hiccup->rmd
  	 println)
