;; **
;;; Note that html can appear inside markdown, so what we just created is valid Rmarkdown.
;; **

;; **
;;; The following function will be used to create temporary files.
;; **

;; @@
(defn create-file [extension]
  (File/createTempFile "temp" (str "."  extension)))
