;; **
;;; Now, let us create a connection with Rserve, to be able to use Rojure:
;; **

;; @@
(def r-conn
  (atom nil))

(defn reset-connection! []
  (reset! r-conn (get-r)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;examples.rmarkdown/reset-connection!</span>","value":"#'examples.rmarkdown/reset-connection!"}
;; <=

;; @@
(reset-connection!)
