;; =>
;;; {"type":"html","content":"<span class='clj-unkown'>#object[org.rosuda.REngine.Rserve.RConnection 0x2c408496 &quot;org.rosuda.REngine.Rserve.RConnection@2c408496&quot;]</span>","value":"#object[org.rosuda.REngine.Rserve.RConnection 0x2c408496 \"org.rosuda.REngine.Rserve.RConnection@2c408496\"]"}
;; <=

;; **
;;; The followwing function will allow us to run R code with several bindings of Clojure values to R variables.
;;; 
;;; Of course, when we create a library out of this example, this will have to be done more carefully, to avoid name conflicts, etc.
;; **

;; @@
(defn call-r [code bindings]
  (doseq [[k v] bindings]
    (r-set! @r-conn (name k) v))
  (r-eval @r-conn
          "result <- NULL")
  (r-eval @r-conn
          (str "result <- {" code "}"))
  (r-get @r-conn "result"))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;examples.rmarkdown/call-r</span>","value":"#'examples.rmarkdown/call-r"}
;; <=

;; **
;;; For example:
;; **

;; @@
(call-r "x+y"
        {:x [1  2  3]
         :y [10 20 30]})
