;; =>
;;; {"type":"list-like","open":"<span class='clj-vector'>[</span>","close":"<span class='clj-vector'>]</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-unkown'>11</span>","value":"11"},{"type":"html","content":"<span class='clj-unkown'>22</span>","value":"22"},{"type":"html","content":"<span class='clj-unkown'>33</span>","value":"33"}],"value":"[11 22 33]"}
