;; **
;;; Now, let us write a function to render Rmarkdown.
;; **

;; @@
(defn render-rmd [rmd bindings]
  (let [rmd-file      ^File (create-file "Rmd")
        rmd-path      (.getAbsolutePath rmd-file)
        out-file      ^File (create-file "html")
        out-path      (.getAbsolutePath out-file)
        _             (spit rmd-path rmd)
        r-code        (str "library(rmarkdown);"
                           "render(
                             input='" rmd-path "',
                             output_file='" out-path "')")
        _ 			  (call-r r-code bindings)
        rendered-plot (slurp out-path)
        ]
    #_(.delete out-file)
    #_(.delete rmd-file)
    (-> rendered-plot
        ;; Cancel some default, to allow for integrating the plot in larger htmls sheets.
        #_(string/replace #",\"fill\":true" ""))))

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;examples.rmarkdown/render-rmd</span>","value":"#'examples.rmarkdown/render-rmd"}
;; <=

;; @@
(-> 	 
 "
 Hi!
 ```{r}
 x*10
 ```
 "
  	(render-rmd {:x [1 2 3]})
  	(hiccup->gorilla {:height 100}))
