ne {\n  padding-top: 12px;\n}\n.html-widget {\n  margin-bottom: 20px;\n}\nbutton.code-folding-btn:focus {\n  outline: none;\n}\n&lt;/style&gt;\n\n\n\n&lt;div class=&quot;container-fluid main-container&quot;&gt;\n\n&lt;!-- tabsets --&gt;\n&lt;script&gt;\n$(document).ready(function () {\n  window.buildTabsets(&quot;TOC&quot;);\n});\n&lt;/script&gt;\n\n&lt;!-- code folding --&gt;\n\n\n\n\n\n\n&lt;div class=&quot;fluid-row&quot; id=&quot;header&quot;&gt;\n\n\n\n\n&lt;/div&gt;\n\n\n&lt;div&gt;\n&lt;div&gt;\n&lt;h5&gt;\nhello\n&lt;/h5&gt;\n&lt;div&gt;\n&lt;button class=&quot;btn btn-primary&quot; data-target=&quot;#block701ad91a-826f-46c8-aaf6-7b90252a6c9e&quot; data-toggle=&quot;collapse&quot;&gt;\n(show/hide) results\n&lt;/button&gt;\n&lt;div id=&quot;block701ad91a-826f-46c8-aaf6-7b90252a6c9e&quot; class=&quot;collapse&quot;&gt;\n&lt;pre&gt;&lt;code&gt;##   x          y\n## 1 0 0.05819959\n## 2 1 0.15940989\n## 3 2 0.86609324\n## 4 3 0.96709317\n## 5 4 0.17293188\n## 6 5 0.32870819&lt;/code&gt;&lt;/pre&gt;\n&lt;p&gt;&lt;img src=&quot;data:image/png;base64,&quot; width=&quot;672&quot; /&gt;&lt;/p&gt;\n&lt;/div&gt;\n&lt;/div&gt;\n&lt;/div&gt;\n&lt;/div&gt;\n\n\n\n\n&lt;/div&gt;\n\n&lt;script&gt;\n\n// add bootstrap table styles to pandoc tables\nfunction bootstrapStylePandocTables() {\n  $(&apos;tr.header&apos;).parent(&apos;thead&apos;).parent(&apos;table&apos;).addClass(&apos;table table-condensed&apos;);\n}\n$(document).ready(function () {\n  bootstrapStylePandocTables();\n});\n\n\n&lt;/script&gt;\n\n&lt;!-- dynamically load mathjax for compatibility with self-contained --&gt;\n&lt;script&gt;\n  (function () {\n    var script = document.createElement(&quot;script&quot;);\n    script.type = &quot;text/javascript&quot;;\n    script.src  = &quot;https://mathjax.rstudio.com/latest/MathJax.js?config=TeX-AMS-MML_HTMLorMML&quot;;\n    document.getElementsByTagName(&quot;head&quot;)[0].appendChild(script);\n  })();\n&lt;/script&gt;\n\n&lt;/body&gt;\n&lt;/html&gt;\n\" width=\"100%\"></iframe>","value":"#object[examples.rmarkdown$hiccup$reify__22163 0x4ae50fe3 \"examples.rmarkdown$hiccup$reify__22163@4ae50fe3\"]"}
;; <=

;; **
;;; Since hiccup is just a data structure, one may create some large and complex hiccup with very little code. That is quite a useful way to generate large rmarkdown documents.
;;; 
;;; Here, we will create a sequence of datasets. For every `i=1,2,...`, the `i`th dataset has 2 to the `i` random samples. Then, we will create an rmarkdown that has one visual paragraph for each such dataset.
;; **

;; @@
  #_(->> (let [n              9
             i->n-samples	(fn [i] (Math/pow 2 i))
             i->dataset		(fn [i]
                              (matds/dataset
   	                             {"x" (repeatedly
                                       (i->n-samples i)
                                        rand)}))
             i->dataset-name (fn [i]
                               (keyword (str "data" i)))
             datasets       (->> (range 1 (inc n))
                                 (map (juxt i->dataset-name
                                            i->dataset))
                                 (into {}))
             hiccup         (->> (range 1 (inc n))
                                 (map (fn [i]
                                        [:collapsible {:title i}
                                         [:r-edn
                                          [[:library :ggplot2]
                                           [:with (i->dataset-name i)
                                            [:qplot :x]]]]]))
                                 (into [:div]))]
         (-> hiccup
             hiccup->rmd
             (render-rmd datasets)
             (hiccup->gorilla {:height 500}))))


  
